import { Typography, Box, AppBar, Container, Toolbar, CardActionArea, Tooltip,
IconButton, Avatar } from '@material-ui/core';
import ForumIcon from '@mui/icons-material/Forum';
import Stack from '@mui/material/Stack';

import React from 'react';

const pages = ['MyThreads', 'MyComments']
const settings = ['Profile', 'Account', 'Logout', 'Sign In'];

const SearchAppBar: React.FC = () => {
  return (
    <Box marginBottom={'70px'}>
      <AppBar position='fixed' style={{zIndex: '3000'}}>
        <Container maxWidth='xl'>
          <Toolbar>
            <ForumIcon sx={{mr: 1}} />
            <Typography variant='h6' component='a' href='/'
              style={{
                color: 'inherit',
                textDecoration: 'none',
                marginRight: '40px',
              }}
            >
              ChitChat
            </Typography>
            <Stack direction='row'>
              {pages.map(page => (
                <CardActionArea key={page} style={{padding: '10px', borderRadius: '10px'}} href='/'>
                  <Typography>{page}</Typography>
                </CardActionArea>
              ))}
            </Stack>
            <Box flex={1}>
              <Tooltip title="Open settings" flex={1}>
                <IconButton>
                  <Avatar alt="Remy Sharp" src="/static/images/avatar/2.jpg" />
                </IconButton>
              </Tooltip>
            </Box>
          </Toolbar>
        </Container>
      </AppBar>
    </Box>
  );
};

export default SearchAppBar;
